INSERT INTO public."Books" (id, name, author, reserved, number_of_pages, rating, description, "Published", "Image") VALUES (9, 'Pride and Prejudice', 'Jane Austen', true, 416, 4, 'When Elizabeth Bennet first meets eligible bachelor Fitzwilliam Darcy, she thinks him arrogant and conceited; he is indifferent to her good looks and lively mind. When she later discovers that Darcy has involved himself in the troubled relationship between his friend Bingley and her beloved sister Jane, she is determined to dislike him more than ever. In the sparkling comedy of manners that follows, Jane Austen shows the folly of judging by first impressions and superbly evokes the friendships, gossip and snobberies of provincial middle-class life.', '2012-06-12', '');
INSERT INTO public."Books" (id, name, author, reserved, number_of_pages, rating, description, "Published", "Image") VALUES (17, 'Ambrose Follows His Nose', 'Dick King-Smith,  Josie Rogers', true, 176, 3, '''Sparkling humour and wonderful characters are Dick King-Smith''s trademarks'' - Books for Your Children

Published to mark the centenary of his birth, a recently discovered funny and poignant animal story by Dick King-Smith, completed by his great granddaughter, Josie Rogers.

Ambrose may seem like an ordinary rabbit but he has the most extraordinary sense of smell. He can detect any aroma from sweets to kittens - and even niffy foxes!

