INSERT INTO public."Books" (id, name, author, reserved, number_of_pages, rating, description, "Published", "Image") VALUES (12, 'One Hundred Years of Solitude', 'Gabriel Garcia Marquez', true, 432, 3, 'Gabriel Garca Mrquez''s great masterpiece is the story of seven generations of the Buenda family and of Macondo, the town they built. Though little more than a settlement surrounded by mountains, Macondo has its wars and disasters, even its wonders and its miracles. A microcosm of Columbian life, its secrets lie hidden, encoded in a book, and only Aureliano Buenda can fathom its mysteries and reveal its shrouded destiny.', '2014-06-03', '');
INSERT INTO public."Books" (id, name, author, reserved, number_of_pages, rating, description, "Published", "Image") VALUES (10, 'To Kill A Mockingbird', 'Harper Lee', true, 320, 5, 'A lawyer''s advice to his children as he defends the real mockingbird of Harper Lee''s classic novel - a black man falsely charged with the rape of a white girl. Through the young eyes of Scout and Jem Finch, Harper Lee explores with exuberant humour the irrationality of adult attitudes to race and class in the Deep South of the 1930s. The conscience of a town steeped in prejudice, violence and hypocrisy is pricked by the stamina of one man''s struggle for justice. But the weight of history will only tolerate so much.', '2015-04-06', '');
INSERT INTO public."Books" (id, name, author, reserved, number_of_pages, rating, description, "Published", "Image") VALUES (14, 'The Red Pyramid: The Graphic Novel (The Kane Chronicles Book 1)', 'Rick Riordan', false, 192, 2, 'The heart-stopping action and magic of Rick Riordan''s bestselling novel The Kane Chronicles: The Red Pyramid explodes off the page in this beautiful graphic novel retelling of the story.', '2013-03-10', '');
INSERT INTO public."Books" (id, name, author, reserved, number_of_pages, rating, description, "Published", "Image") VALUES (15, 'Top Gear: My Dad Had One of Those', 'Giles Chapman  Richard Porter', false, 160, 4, 'Good old Dad and his good old Dad''s car. As solid and dependable as the man himself, if a little less balding, Dad''s car was almost a member of the family, whisking you to exciting days out, or just to visit boring relatives in distant parts of the country to the chant of ''are we nearly there yet?'' Like the man behind the wheel, Dad''s car made you feel safe and secure, because it was as reassuring and sensible as he was. Maybe in an idle moment Dad dreamt of driving something rakish and fast, just like in idle moments he dreamt that your Mum was Twiggy, but the demands of family life meant soft tops, hard suspension and anything even remotely sporty were off the cards. Even anything less than four doors would have been wildly hedonistic. But although the family car may not have been the very essence of rock ''n'' roll, Dad was proud of it.', '2007-05-17', '');
